changeSet.createView:
SELECT T1.Id, T1.Code, T1.Description, T1.Type, T1.NotificationType, T1.errorCodes, T1.active, T1.Version , T1.LastMntBy, T1.LastMntOn, T1.RecordStatus, T1.RoleCode, T1.NextRoleCode, T1.TaskId, T1.NextTaskId, T1.RecordType, T1.WorkflowId FROM EXTINTERFACECONF_TEMP T1
UNION ALL
SELECT T1.Id, T1.Code, T1.Description, T1.Type, T1.NotificationType, T1.errorCodes, T1.active, T1.Version , T1.LastMntBy, T1.LastMntOn, T1.RecordStatus, T1.RoleCode, T1.NextRoleCode, T1.TaskId, T1.NextTaskId, T1.RecordType, T1.WorkflowId FROM ExtInterfaceConf T1 WHERE NOT EXISTS (SELECT 1 FROM EXTINTERFACECONF_TEMP WHERE Id = T1.Id);

